"use strict";document.addEventListener("DOMContentLoaded",(function(){const t=document.getElementById("logoutLink");t&&t.addEventListener("click",(function(e){e.preventDefault();const n=t.dataset.logoutUrl,o=t.dataset.csrfToken||t.dataset.csrfToken;fetch(n,{method:"POST",headers:{"X-CSRFToken":o}}).then((t=>{t.ok?window.location.reload():window.location.href="/"})).catch((()=>{window.location.href="/"}))}))}));